import React from 'react';
import reactDom from 'react-dom';
import './Cart.css';
import Modal from '..Meals/UI/Modal';

function Cart(props){

    const cartItems = (
        <ul className="cart-items">
            {[{id: 'e1', name: 'Sushi', amount: '2', price: 17.2}].map((item) => <li>item.name</li>)}
        </ul>
    );

    return(

        <Modal>
            {cartItems}
            <div className="total">
                <span>Total Amount</span>
                <span>Rs 77.2</span>
            </div>
            <div className="actions">
                <button className="button--alt">Order</button>
                <button className="button-alt">Close</button>
            </div>
            </Modal>
    );
}

export default Cart;
